    }}>
      <li parentName="ol">
        <p parentName="li"><strong parentName="p">{`User Manuals:`}</strong>{` Contains guidelines to explain in detail to users how to
use the different features of the showcase.`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li"><strong parentName="p">{`Contributor's Guide:`}</strong>{` `}<em parentName="p">{`under development`}</em></p>
